@Test
  public void groupBy_returnsNotNullValue() {
    /* Given */
    SelectFromImpl from = new SelectFromImpl("my_table", mock(SqlPart.class));

    /* When */
    GroupBy result = from.groupBy("a");

    /* Then */
    assertThat(result, is(notNullValue()));
  }

